import React from 'react'
import  products  from './product'

function ProductPage() {
    return (
        <div className="product-section">
            <div className="image-wrapper">
                <div className="main-image">
                {
                    products.map((item) => {
                        const {ImageSrc} = item
                        return  <img src={ImageSrc[0]} alt=""/>
                    })
                    
                }
                   

                </div>
                {
                    products.map((item) => {
                        const {ImageThumbSrc} = item
                        return  <div className="thumbnails">
                    
                    <img src={ImageThumbSrc[0]} alt=""/>
                    <img src={ImageThumbSrc[1]} alt=""/>
                    <img src={ImageThumbSrc[2]} alt=""/>
                    <img src={ImageThumbSrc[3]} alt=""/>
                        </div>
                    })
                    
                }
                
            </div>
            <div className="details">

            </div>
        </div>
    )
}

export default ProductPage
